import React, { useState } from "react";
import { useDispatch } from "react-redux";
import { fetchData } from "../../redux/actions";

const MyInput = () => {
	const [ip, setIp] = useState();
	const dispatch = useDispatch();
	return (
		<>
			<input />
			<button
				onClick={() => {
					dispatch(fetchData());
				}}
			>
				Get data
			</button>
			;
		</>
	);
};

export default MyInput;
